package source;

/**
 * This class multiplies two numbers.
 * @author Harveer Dole
 */
public class Times implements OperatorState {

  /**
   * method returns calculation of a and b being multiplied.
   */
  @Override
  public float eval(float a, float b) {
    // TODO Auto-generated method stub
    return a * b;
  }
  
}
